from string import *

ALPHABET = ascii_uppercase
n = len(ALPHABET)
enc = "_JVYYRB_QFX_PKKEYKVSQJREHA_HD_JZGBMR_FBFG_HG"

def rev_offset(c, offset):
    return ALPHABET[(ALPHABET.index(c) - offset) % n]

msg_enc = ''
offset = 1
for i in range(0, len(enc), 5):
    for j in range(5):

        if enc[i+j] == '_':
            msg_enc += '_'

        else:
            msg_enc += rev_offset(enc[i + j], offset)
    offset = (offset * 3 + 4) % n

print(msg_enc)
